import React from "react";
import { makeStyles, Drawer, List, ListItem, Divider, Card, Typography, ListItemIcon } from "@material-ui/core";
import ListItemText from "@material-ui/core/ListItemText"
import PersonOutlineOutlinedIcon from '@material-ui/icons/PersonOutlineOutlined';
import SettingsOutlinedIcon from '@material-ui/icons/SettingsOutlined';
import NotListedLocationOutlinedIcon from '@material-ui/icons/NotListedLocationOutlined';
import InfoOutlinedIcon from '@material-ui/icons/InfoOutlined';
import shadows from "@material-ui/styles";
import Box from "@material-ui/core/Box"

import styles from "../styles/AppDrawerStyle";

const useStyles = makeStyles(styles);

function AppDrawer(props) {

    const classes = useStyles();

  return (
    <React.Fragment>
      <Box boxShadow={3}>
      <Drawer
        className={classes.drawer}
        open={props.open}
        variant="persistent"
        anchor="left"
        classes={{
          paper: classes.drawerPaper
        }}
        boxShadow={3}       
      >
        <List className={classes.drawerHeader}>
          <ListItem>
            <Typography>Future Survey</Typography>
          </ListItem>
        </List>
        <Divider />
        <List className={classes.drawerBody}>
          <ListItem button>
            <ListItemIcon>
              <PersonOutlineOutlinedIcon />
            </ListItemIcon>
            <ListItemText primary="Account"/>
          </ListItem>
          <ListItem button>
            <ListItemIcon>
              <SettingsOutlinedIcon />
            </ListItemIcon>
            <ListItemText primary="Settings"/>
          </ListItem>
        </List>
        <Divider />
        <List className={classes.drawerBody}>
          <ListItem button>
            <ListItemIcon>
              <NotListedLocationOutlinedIcon />
            </ListItemIcon>
            <ListItemText secondary="Help & Feedback"/>
          </ListItem>
          <ListItem button>
            <ListItemIcon>
              <InfoOutlinedIcon />
            </ListItemIcon>
            <ListItemText secondary="About"/>
          </ListItem>
        </List>
      </Drawer>
      </Box>
    </React.Fragment>
  );

}

export default AppDrawer;
